import {
  createBrowserRouter,
  RouterProvider,
  Outlet,
} from "react-router-dom";

const router=createBrowserRouter([
  {
    path:"/",
    element:<Layout />,
    errorElement:<ErrorPage />,
    children:[
      {
        path:"/",
        element:<Home />
      },
      {
        path:"/learning",
        element:<Learning />
      },
      {
        path:"/signup",
        element:<Signup />
      },
      {
        path:"/signin",
        element:<Signin />
      },
      {
        path:"/products/",
        element:<Products />
      },
      {
        path:"/products/:id",
        element:<Product />
      }
    ]
  }
])

function App() {
  return (
    <div>

    </div>
  );
}

export default App;
